script: |
  super -f text -I q5966.spq | sort > q5966.out

inputs:
  - name: q5966.spq
    data: |
      SELECT + col1 + - - col0 AS col1, + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 / + col2 / - CAST ( NULL AS INTEGER ) * - 81 NOT IN ( ( - - col1 ) - - col1, + col1 / + col2, + col2, - - col2, - ( CAST ( NULL AS INTEGER ) ) );
  - name: tab0

outputs:
  - name: q5966.out
    data: |
